import logo from './logo.svg';
import './App.css';
import axios from 'axios';
import FormControl from 'react-bootstrap/FormControl'
import {Form, Button, Col, Row} from 'react-bootstrap'
import { useEffect, useState } from "react";


function App() {

const[userdata, setUserdata] = useState(null);

  useEffect(() => {
    axios.get('http://localhost:5000/api/user/getdata')
    .then(res => setUserdata(res.data))
    .catch(err => console.log(err))
  }, []);
  return (
    <div className="App">
    <Form>
  <Row>
    <Col md={2}>
    <FormControl placeholder="First Name" type="text" />
    </Col>
    <Col md={2}>
    <FormControl placeholder="Last Name" type="text" />
    </Col>
  </Row>
  <br />
  <Row>
  <Col md={2}>
    <FormControl placeholder="Email" type="email" />
    </Col>
    <Col md={2}>
    <FormControl placeholder="Mobile Number" type="number" />
    </Col>
  </Row>
<br />
  <Button variant="primary" type="submit">
    Submit
  </Button>
</Form>
    </div>
  );
}

export default App;
